window.bookSummaryJSON = "<p><b>Four brothers. Two missions. One explosive story. Jennifer Lynn Barnes returns to the world of her #1 bestselling, TikTok sensation Inheritance Games trilogy, and the stakes have never been higher.</b></p> <p><b>Grayson Hawthorne</b> was raised as the heir apparent to his billionaire grandfather, taught from the cradle to put family first. Now the great Tobias Hawthorne is dead and his family disinherited, but some lessons linger. When Grayson’s half-sisters find themselves in trouble, he swoops in to do what he does best: take care of the problem—efficiently, effectively, mercilessly. And without getting bogged down in emotional entanglements.</p> <p><b>Jameson Hawthorne</b> is a risk-taker, a sensation-seeker, a player of games. When his mysterious father appears and asks for a favor, Jameson can’t resist the challenge. Now he must infiltrate London’s most exclusive underground gambling club, which caters to the rich, the powerful, and the aristocratic, and win an impossible game of greatest stakes. Luckily, Jameson Hawthorne lives for impossible.</p> <p>Drawn into twisted games on opposite sides of the globe, Grayson and Jameson—with the help of their brothers and the girl who inherited their grandfather’s fortune—must dig deep to decide who they want to be and what each of them will sacrifice to <i>win.</i></p> <p><i>While you wait for </i>The Brothers Hawthorne<i> to come out, try Jennifer Lynn Barnes’s thrilling mystery series, The Naturals.</i></p>"; 
